import React from "react";
import { BrowserRouter as Routers, Router, Route } from "react-router-dom"; // Change 'Router' to 'BrowserRouter'
import HomePage from "./components/pages/Home";

function App() {
  return (
    <Routers>
      <Router>
        <div>
          <Route exact path="/home" component={HomePage} />
        </div>
      </Router>
    </Routers>
  );
}

export default App;
